import "./App.css";
import React from "react";
import { Route  } from "react-router-dom";
import Principal from "./f_components/f_principal/principal";
import Home from "./components/f_home/home";
import Details from "./f_components/f_details/details";
function App() {
  return (
    <div className="App">
        <Route path="/" component={Principal}></Route>
        <Route path="/home" component={Home}></Route>
        <Route path="/home/details" component={Details}></Route>
        
    </div>
  );
}

export default App;
